import React from "react";
import "./nav.css";
const Nav = () => {
  return (
    <>
      <div className="nav-main" id="navmain">
        <div className="img"></div>
        <div className="list" id="list">
          <ul>
            <a href="top">
              <li>Home</li>
            </a>
            <a href="#about">
              <li>About⇂</li>
            </a>
            <a href="#services">
              <li>Services⇂</li>
            </a>
            <a href="#blog">
              <li>Blog⇂</li>
            </a>
            <a href="#footer">
              <li>Contact ⇂</li>
            </a>
          </ul>
        </div>
        <button className="primary-btn" id="quote">
          Request A Quote
        </button>
        {/* hamburger */}
        <div className="hamburger">
          <input type="checkbox" id="checkbox" onClick={navmanu} />
          <label for="checkbox" className="toggle">
            <div className="bars" id="bar1"></div>
            <div className="bars" id="bar2"></div>
            <div className="bars" id="bar3"></div>
          </label>
        </div>
      </div>
    </>
  );
};

export default Nav;

function navmanu() {
  var navmain = document.getElementById("navmain");
  navmain.style.height = "100vh";
  navmain.style.position = "absolute";
  navmain.style.transition = "absolute";
}
